import React from "react";
import styled from "styled-components";
import logo from "../assets/logo.png";

const StyledHeader = styled.header`
    width: 80vw;
    margin: 80px auto;
    display: flex;
    justify-content: center;
    background-color: #8D6B94;   
    border-radius: 1rem;
    box-shadow: 0px 0px 3px 1px black;
`;
const Logo = styled.img`
    width: 100%;
    max-width: 80px;

`;
const LogoWithName = styled.div`
    display: flex;
    h1 {
        font-size: 2rem;
        display: flex;
        align-items: center;
        text-transform: uppercase;
        letter-spacing: 1rem;
    }
`;

function Header() {
  return (
    <StyledHeader>
        <LogoWithName className="">
          <figure>
            <Logo src={logo} alt="" />
          </figure>
          <h1>CryptoCurrencyPriceTracker</h1>
        </LogoWithName>
    </StyledHeader>
  );
}

export default Header;
